import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-flight-information',
  templateUrl: './flight-information.component.html',
  styleUrls: ['./flight-information.component.css']
})
export class FlightInformationComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<table mat-table class="mat-elevation-z8">

  <ng-container matColumnDef="flightNumber">
    <td mat-cell *matCellDef="let element"> {{element.flightNumber}} </td>
  </ng-container>

  <ng-container matColumnDef="origin">
    <td mat-cell *matCellDef="let element"> {{element.origin}} </td>
  </ng-container>

  <ng-container matColumnDef="originDate">
    <td mat-cell *matCellDef="let element"> {{element.originDate | date: 'd/M/yyyy'}} </td>
  </ng-container>

  <ng-container matColumnDef="destination">
    <td mat-cell *matCellDef="let element"> {{element.destination}} </td>
  </ng-container>

  <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
  <tr mat-row *matRowDef="let row; columns: displayedColumns;" (click)="onFlightClicked(row)"></tr>
</table>
